    public static int findMaxConsecutiveOnes(int[] nums) {
        int maxConsecutiveOnes = 0;
        int currentConsecutivesOne = 0;
        for (int num : nums) {
            if (num == 0) {
                maxConsecutiveOnes = Math.max(currentConsecutivesOne, maxConsecutiveOnes);
                currentConsecutivesOne = 0;
                continue;
            }
            currentConsecutivesOne = currentConsecutivesOne + 1;
        }

        return Math.max(currentConsecutivesOne, maxConsecutiveOnes);
    }

    public static int findMaxConsecutiveOnesFail(int[] nums) {
        int maxConsecutiveOnes = 0;
        int currentConsecutivesOne = 0;
        for (int i = 0; i < nums.length; i++) {
            int num = nums[i];
            if (num == 0) {
                if (currentConsecutivesOne > maxConsecutiveOnes) {
                    maxConsecutiveOnes = currentConsecutivesOne;
                    currentConsecutivesOne = 0;
                }
                continue;
            }
            currentConsecutivesOne = currentConsecutivesOne + 1;
        }

        return Math.max(currentConsecutivesOne, maxConsecutiveOnes);
    }
